import React from 'react';
import ImageButton from '../atoms/imageButton';
import './sidebar.css';
import FriendImg from '../../resource/image/friendIcon.png';
import ChatImg from '../../resource/image/chatIcon.png'
import {BrowserRoter as Router, Route} from 'react-router-dom';
import friendView from '../../pages/mainBoard/View/friendView'

function Header() : any {
  const btnCss = {
    'padding': '21px'
  }
  return (
      <div className="sidebar">
        <ImageButton imageSrc={FriendImg} alt={'친구'} css={btnCss} link={'/friend'}/>
        <ImageButton imageSrc={ChatImg} alt={'친구'} css={btnCss} link={'/chat'}/>
        <Route component={friendView}/>
      </div>
  );
}

export default Header;
